    //判断单词函数
    // 判断单词是否正确，三个参数，1，点击的字母，2.单词长度 3.正确单词拼写 
    JudgingWords(a, n, word) {
        n = parseInt(n)
        a = String(a)
        if (typeof (str) == "undefined" && typeof (arr) == "undefined") {
            str = "";
            arr = [];
            str = str + a;
            count = 0
            count++
            arr.push(a)
        } else {
            arr.push(a);
            count++
            str = str + a;
        }
        if (str.length == n) {
            if (str == word) {
                setTimeout(() => {
                    str = "";
                    count = 0
                    arr = []
                }, 500);
                return true;
            } else {
                setTimeout(() => {
                    str = "";
                    count = 0
                    arr = []
                }, 500);
                return false
            }
        }
    }

    // 显示框单词
    showWord() {
        if (str.length == 1) {
            letter1 = this.add.image(200, 321, arr[0] + "2").setOrigin(0, 0);
            letter1.setDepth(2)
            count3 = 1
        }
        if (str.length == 2) {
            letter2 = this.add.image(240, 321, arr[1] + "2").setOrigin(0, 0);
            letter2.setDepth(2)
            count3 = 2
        }
        if (str.length == 3) {
            letter3 = this.add.image(280, 321, arr[2] + "2").setOrigin(0, 0);
            letter3.setDepth(2)
            count3 = 3
        }
        if(str.length == 4){
            letter4 = this.add.image(320 , 321, arr[3]+"2").setOrigin(0, 0); 
            letter4.setDepth(2)
            count3 = 4                            
        }
        if(str.length == 5){
            letter5 = this.add.image(360 , 321, arr[4]+"2").setOrigin(0, 0); 
            letter5.setDepth(2)
            count3 = 5                            
        }
    }

