    //抽屉闪烁，点击抽屉，打开抽屉，显示电线
    clickDrawer() {
        this.drawer1.visible = true
        this.drawer2.visible = true
        this.drawer_interval = setInterval(() => {
            setTimeout(() => {
                this.drawer2.visible = false
            }, 200);
            setTimeout(() => {
                this.drawer2.visible = true
            }, 400);          
        }, 400);
        this.drawer1.on('pointerdown',()=>{
            //点击抽屉切换图片，显示抽屉被拉开的柜子
            clearInterval(this.drawer_interval)
            setTimeout(() => {
                this.drawer2.destroy()
                this.drawer1.destroy()
                this.table2.visible = true
                this.wire.visible = true
            }, 100);
            
        },this)
        this.drawer2.on('pointerdown',()=>{
            //点击抽屉切换图片，显示抽屉被拉开的柜子
            clearInterval(this.drawer_interval)
            setTimeout(() => {
                this.drawer2.destroy()
                this.drawer1.destroy()
                this.table2.visible = true
                this.wire.visible = true
            }, 100);
            
        },this)
        //调用点击电线函数
        this.clickWire()
    }

